script: |
  super -f text -I q11174.spq | sort > q11174.out

inputs:
  - name: q11174.spq
    data: |
      SELECT DISTINCT + - col0 * + col0 + - col1 / + cor0.col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q11174.out
    data: |
      -4096
      -6400
      -9
